import React from "react";
import { Link } from "react-router-dom";
import Section from "../components/UI/Section";
// import SectionDivider from "../components/UI/SectionDivider";
import { motion } from "framer-motion";
import DueDateCountdown from "../components/DueDateCountdown"; // ðŸ‘ˆ new import

const Home = () => {
  return (
    <div className="min-h-screen bg-white">
      <Section center tightTop compact>
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, ease: "easeOut" }}
          className="relative overflow-hidden rounded-[2.5rem] border border-babyBlue/30 bg-gradient-to-br from-white via-pastelGreen/40 to-white px-6 py-20 text-center shadow-[0_25px_60px_-35px_rgba(167,216,240,0.6)]"
        >
          {/* Decorative divider */}
          <div className="pointer-events-none absolute inset-y-0 left-1/2 hidden w-px -translate-x-1/2 bg-gradient-to-b from-transparent via-babyBlue/20 to-transparent md:block" />

          {/* Title */}
          <motion.h1
            initial={{ opacity: 0, y: 24, scale: 0.98 }}
            animate={{ opacity: 1, y: 0, scale: [0.98, 1.03, 1] }}
            transition={{ duration: 0.55, ease: "easeOut" }}
            className="mb-6 text-center font-serif leading-tight text-babyBlue text-4xl sm:text-5xl tracking-tight"
          >
            <motion.span
              initial={{ opacity: 0, y: 12 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, ease: "easeOut", delay: 0.1 }}
              className="font-cursive text-6xl sm:text-[4.75rem] inline-block mr-3"
            >
              Taylor-Made
            </motion.span>
            <motion.span
              initial="hidden"
              animate="visible"
              variants={{
                hidden: { opacity: 0 },
                visible: {
                  opacity: 1,
                  transition: {
                    delayChildren: 0.85,
                    staggerChildren: 0.045,
                  },
                },
              }}
              className="inline-block align-baseline"
            >
              {"Baby Planning".split("").map((char, index) => (
                <motion.span
                  key={index}
                  variants={{
                    hidden: { opacity: 0, y: 10 },
                    visible: {
                      opacity: 1,
                      y: 0,
                      transition: { duration: 0.3, ease: "easeOut" },
                    },
                  }}
                  className="inline-block"
                >
                  {char === " " ? "\u00a0" : char}
                </motion.span>
              ))}
            </motion.span>
          </motion.h1>

          {/* Subtitle */}
          <p className="text-lg md:text-xl text-black/70 max-w-2xl mx-auto">
            A calm, confident path to welcoming your little one. Personalized
            registries, nursery design, shower planning, and ongoing
            supportâ€”tailored to your family.
          </p>

          {/* Hero image */}
          <img
            src="/assets/hero-baby.png"
            alt="Baby Planning Illustration"
            className="mx-auto mt-6 max-w-md drop-shadow-lg"
          />

          {/* Buttons */}
          <div className="mt-8 flex flex-wrap justify-center gap-4">
            <Link
              to="/services"
              className="btn btn-primary px-8 py-3 text-base tracking-wide"
            >
              Explore Services
            </Link>
            <Link
              to="/contact"
              className="px-8 py-3 rounded-full border border-babyBlue/50 bg-white text-black tracking-wide transition hover:border-babyBlue hover:shadow-lg"
            >
              Book a Consultation
            </Link>
          </div>

          {/* Features */}
          <div className="mt-12 grid gap-6 text-left text-black/80 md:grid-cols-3">
            {[
              {
                icon: "ðŸ¼",
                label: "Invite-Only",
                detail: "A discreet client list curated by referral.",
              },
              {
                icon: "ðŸ§¸",
                label: "White-Glove Concierge",
                detail: "Taylor personally oversees every decision.",
              },
              {
                icon: "ðŸ‘¶",
                label: "Confidential Always",
                detail: "NDA-backed planning and event management.",
              },
            ].map(({ icon, label, detail }) => (
              <div
                key={label}
                className="rounded-2xl border border-babyBlue/30 bg-white/70 px-5 py-4"
              >
                <div className="text-3xl">{icon}</div>
                <p className="mt-3 font-serif text-lg text-black">{label}</p>
                <p className="text-sm text-black/70">{detail}</p>
              </div>
            ))}
          </div>
        </motion.div>
      </Section>

      {/* Countdown Section */}
      <Section title="Countdown to Baby Day ðŸŽ‰" center>
        <DueDateCountdown dueDate="2025-12-01" />
      </Section>

      {/* Rest of your sections remain unchanged */}
      {/* ... keep Introduction, Services, Testimonials, etc. ... */}

      <Section title="Services Snapshot â€” Taylor-Made for You" tightTop compact>
        <div className="px-6 py-4">
          <div className="grid gap-6 md:grid-cols-2 lg:grid-cols-3">
            {[
              {
                title: "Registry & Gear Concierge",
                desc: "Every list curated, managed, and delivered â€” you simply approve the final selections.",
                icon: "ðŸ—’ï¸",
              },
              {
                title: "Personal Shopping",
                desc: "In-home or virtual consultations, VIP access, and white-glove delivery for every must-have.",
                icon: "ðŸ›ï¸",
              },
              {
                title: "Nursery & Home Design",
                desc: "Furniture, safety, and styling planned with your design team for a seamless reveal.",
                icon: "ðŸ›ï¸",
              },
              {
                title: "Events & Celebrations",
                desc: "Baby showers, sip-and-sees, and bespoke gifting handled with total discretion.",
                icon: "ðŸ¥‚",
              },
              {
                title: "Family Integration",
                desc: "Support for siblings, pets, and family dynamics so everyone feels considered.",
                icon: "ðŸ‘¨â€ðŸ‘©â€ðŸ‘§â€ðŸ‘¦",
              },
              {
                title: "Ongoing Concierge",
                desc: "Fourth-trimester coaching, vetted experts, and beyond-baby planning on standby.",
                icon: "â³",
              },
            ].map((service) => (
              <motion.div
                whileHover={{ scale: 1.05, y: -4 }}
                transition={{ type: "spring", stiffness: 200 }}
                key={service.title}
                className="rounded-3xl border border-babyBlue/40 bg-white/80 px-6 py-7 shadow-sm backdrop-blur"
              >
                <div className="text-4xl">{service.icon}</div>
                <h3 className="mt-4 font-serif text-2xl text-black">
                  {service.title}
                </h3>
                <p className="mt-2 text-sm text-black/70 leading-relaxed">
                  {service.desc}
                </p>
              </motion.div>
            ))}
          </div>
        </div>
      </Section>

      {/* Keep your other sections (Testimonials, Process, Membership, About Me) */}
    </div>
  );
};

export default Home;
